INSERT INTO `conteudo` (`id`, `titulo`, `conteudo`, `data`) VALUES
(1, 'Quem Somos', '<div class="txt_interna"><div class="txt_interna"><p>Desde outubro de&nbsp;2010 a emissora foi segmentada ao público jovem, com uma linguagem din&acirc;mica e irreverente. Seguindo uma programa&ccedil;&atilde;o musical no estilo Jovem e Popular, a rádio atinge diretamente o gosto do jovem brasileiro na atualidade.</p><p>Contando com uma talentosa e criativa equipe de profissionais, hoje a&nbsp;Positiva Fm&nbsp;&eacute; refer&ecirc;ncia por seus programas, ditando tend&ecirc;ncias, ao levar entretenimento e divers&atilde;o de qualidade a todos os seus ouvintes.</p><p>Com muitas novidades, lan&ccedil;amentos, informa&ccedil;&atilde;o, humor, e interatividade, a Positiva Fm se consolida como a rádio que mais cresce em audi&ecirc;ncia no público jovem em todo país.</p></div></div>', '2011-08-18 23:58:09'),
(2, 'Programação', '<p align="left">Fique ligado na programa&ccedil;&atilde;o da Rádio After para conferir o melhor som com a melhor programa&ccedil;&atilde;o.</p><p align="left">Aqui voc&ecirc; terá a chance de ganhar vips para as principais festas e baladas que acontecem em S&atilde;o Paulo.</p><p align="left">Em breve estaremos divulgando toda a grade de programa&ccedil;&atilde;o Rádio After.</p><p align="left">Obrigada </p>', '2011-07-27 06:46:13'),
(3, 'Promoções', '<p align="center">&nbsp;</p><p align="center">&nbsp;</p><p align="center">&nbsp;</p><p align="center">&nbsp;</p><p align="center">Central de Promo&ccedil;&otilde;es</p>', '2011-05-19 20:36:52'),
(4, 'Fale Conosco', '<p align="center">&nbsp;</p><p align="center">&nbsp;</p><p align="center">&nbsp;</p><p align="center">Interatividade, dúvidas, dicas, sugest&otilde;es:</p>', '2012-07-05 23:11:38'),
(5, 'Como Ouvir', '<p>Apesar de nossos esfor&ccedil;os para tornar o acesso totalmente automático para os<br />ouvintes, algumas v&ecirc;zes os internautas poder&atilde;o enfrentar problemas para<br />acessar a rádio. Para solucionar estes problemas, criamos esta página.<br /><br /><strong>&bull; <a href="#1"><font color="#000000">Entro no site mas n&atilde;o ou&ccedil;o a rádio.</font></a><br /><br />&bull; <a href="#2"><font color="#000000">Utilizo o Firefox e n&atilde;o consigo ouvir a rádio.</font></a><br /><br />&bull; <a href="#3"><font color="#000000">Utilizo Internet Explorer e n&atilde;o consigo ouvir a rádio.</font></a><br /><br />&bull; <a href="#4"><font color="#000000">O áudio sofre interrup&ccedil;&otilde;es constantes.</font></a><br /><br />&bull; <a href="#5"><font color="#000000">Sou usuário de Macintosh e n&atilde;o estou conseguindo ouvir a rádio.</font></a></strong><br /><br /><br /><a name="1" /><strong>Entro no site mas n&atilde;o ou&ccedil;o a rádio.</strong><br /><br />Verifique a conex&atilde;o dos cabos das caixas de som, o volume do áudio, nas<br />próprias caixas e tamb&eacute;m no Windows. Verifique se a placa de áudio está<br />funcionando apropriadamente. Para verificar se a placa de áudio está<br />funcionando adequadamente, tente abrir um arquivo de áudio no Windows Media<br />Player (mp3 ou wma).<br /><br /><a name="2" /><strong>Utilizo o Firefox e n&atilde;o consigo ouvir a rádio.</strong><br /><br />Se voc&ecirc; navega na internet utilizando Firefox, verifique se foi instalado o<br />Windows Media Player Plug-in for Firefox. Caso n&atilde;o tenha sido instalado,<br /><a href="https://addons.mozilla.org/pt-BR/firefox/addon/2119" target="_blank"><font color="#000000">clique aqui</font></a> para acessar a página de download e instale o plug-in.<br /><br /><a name="3" /><strong>Utilizo Internet Explorer e n&atilde;o consigo ouvir a rádio.</strong><br /><br />Se voc&ecirc; utiliza Internet Explorer, verifique se voc&ecirc; possui a última vers&atilde;o<br />do Microsoft Windows Player. Para fazer o download da última vers&atilde;o, clique<br />no link abaixo.<br /><a href="http://www.microsoft.com/windows/windowsmedia/player/download/" target="_blank"><strong><font color="#000000">http://www.microsoft.com/windows/windowsmedia/player/download/</font></strong></a> Se voc&ecirc; acessar o site e o Internet Explorer solicitar a ativa&ccedil;&atilde;o do Active<br />X, autorize. Sem ele, n&atilde;o será possível ouvir a rádio.<br />Ou tente ouvir a rádio pelo próprio programa do Windows Media Player, clicando no ícone<br />na barra superior da página da Rádio. <br /><a name="4" /><strong>O áudio sofre interrup&ccedil;&otilde;es constantes.</strong><br /><br />Verifique se a sua conex&atilde;o de banda larga está com a qualidade adequada:<br />interrup&ccedil;&otilde;es e quedas de velocidade na conex&atilde;o influenciam diretamente na<br />sua experi&ecirc;ncia de áudio. Se voc&ecirc; estiver compartilhando a conex&atilde;o com<br />outros usuários, a taxa de transfer&ecirc;ncia de dados &eacute; dividida pela quantidade<br />de pessoas conectadas ao servi&ccedil;o. A taxa mínima de conex&atilde;o necessária para<br />ouvir a rádio adequadamente &eacute; de 256 Kbps por computador.<br /><br /><a name="5" /><strong>Sou usuário de Macintosh e n&atilde;o estou conseguindo ouvir a rádio.</strong><br /><br />Para usuários de Macintosh rodando OSX 10.4.x ou superior, recomendamos a<br />instala&ccedil;&atilde;o do Flip4Mac (www.flip4mac.com).Ao ouvir a rádio no Mac, com o<br />Flip4Mac instalado, o QuickTime deverá ser acionado automaticamente. Aguarde<br />alguns segundos e o QuickTime irá carregar o streaming. Se mesmo assim<br />continuar a ter problemas para acessar a rádio, verifique as configura&ccedil;&otilde;es<br />do QuickTime (no menu QuickTime Player&gt;QuickTime Preferences&gt;Advanced,<br />desabilite o ítem &sup2;enable kiosk mode&sup2;. Em Streaming, ajuste a velocidade de<br />conex&atilde;o. Em Brownser, ajuste o tamanho do cache. Cache em 0 pode gerar<br />problemas de interrup&ccedil;&otilde;es. Se voc&ecirc; acessa a internet via rede, verifique se<br />programas como firewalls est&atilde;o impedindo o tr&acirc;nsito do streaming atrav&eacute;s das<br />portas padr&otilde;es. Em QuickTime Preferences&gt;Advanced&gt;Transport Setup, vefique<br />se o protocolo de transporte (Transport protocol) está configurado em HTTP e<br />a porta (Port ID) está configurada como 80.<br /><br />Continua a enfrentar problemas? Entre em contato conosco e fa&ccedil;a um relato do<br />problema para que possamos encontrar a solu&ccedil;&atilde;o.</p>', '2011-07-16 11:06:38'),
(6, 'Como Anunciar', '<p><strong>POR QUE ANUNCIAR NO MEIO RÁDIO?</strong></p><p><strong>O rádio está junto ao consumidor na hora da compra.<br /></strong>Segundo as pesquisas relizadas, o rádio &eacute; o veículo que está junto a 93% dos consumidores na hora que antecede a compra.</p><p><strong>As pessoas passam mais tempo ouvindo rádio.<br /></strong>Para convencer o consumidor o comercial tem que ser ouvido várias vezes ao dia e o rádio &eacute; o veículo que ele mais ouve, em m&eacute;dia 3 horas e 45 minutos por dia.</p><p><strong>Consumidor passa 17% mais tempo com o rádio que outros meios.<br /></strong>Pesquisa do Ibope confirma que as pessoas que fazem compras passam em m&eacute;dia 17% mais tempo ouvindo o rádio que vendo a televis&atilde;o, lendo jornal, revista ou internet - o que dá a seu comercial 17% mais chance de ser absorvido.</p><p><strong>O rádio chega onde outros veículos n&atilde;o.<br /></strong>O rádio &eacute; o único veículo que atinge o consumidor em qualquer lugar: come&ccedil;ando o dia com o rádio-relógio, sendo companhia no caf&eacute; da manh&atilde;, no &ocirc;nibus e no carro, a caminho do trabalho, no restaurante ou na lanchonete, na praia, na fazenda, no cooper e na bicicleta com o walkman (possuído por 51% da popula&ccedil;&atilde;o), ao lado, enquanto navega na internet. Enfim, o rádio &eacute; o único veículo que tem um público exclusivo, enorme e pronto para receber sua mensagem.</p><p><strong>O rádio está em 99% das casas.<br /></strong>Al&eacute;m desta vantagem nas casas, o rádio está em 83% dos carros.</p><p><strong>O horário nobre do rádio dura 13 horas.<br /></strong>O rádio &eacute; imbatível das 6 horas da manh&atilde; at&eacute; as 19 horas. S&atilde;o quatro vezes mais efici&ecirc;ncia a favor do rádio, uma das raz&otilde;es do grande crescimento do veículo nos últimos anos.</p><p><strong>Uma produ&ccedil;&atilde;o de alto nível no rádio custa 95% a menos.<br /></strong>Isto porque o rádio usa a imagina&ccedil;&atilde;o do consumidor. Ex.:... quando voc&ecirc; mostra uma &quot;bela mulher&quot; nos outros meios, ela pode ou n&atilde;o agradar o consumidor. Mas se voc&ecirc; diz a ele, no rádio que ali está uma &quot;bela mulher&quot;, ele imagina a mulher de seus sonhos.</p><p>&nbsp;</p><p><table width="96%" height="" align="center" border="0"><tr><td>Em 01 dia sozinho o rádio consegue cobrir</td><td>66% da popula&ccedil;&atilde;o</td></tr><tr><td>Em 02 dias</td><td>78% da popula&ccedil;&atilde;o</td></tr><tr><td>Em 07 dias</td><td>95% da popula&ccedil;&atilde;o</td></tr><tr><td>Em 15 dias vai a </td><td>97% da popula&ccedil;&atilde;o</td></tr><tr><td><font size="1">Fonte: IBOPE</font></td></tr></table><a href="mailto:comercial@radioafter.com" /></p>', '2012-05-04 17:09:36');
